import React, { useState } from 'react';
import axios from 'axios'; // Import Axios for making HTTP requests

const LoginHome = () => {
  const [username, setUsername] = useState(''); // Define state for username
  const [password, setPassword] = useState(''); // Define state for password

  const handleLogin = () => { // Function to handle login
    // Add your authentication logic here
    axios.post('/login', { username, password }) // Send POST request to login endpoint
      .then(response => { // Handle successful response
        console.log(response.data);
        // Handle successful login (e.g., redirect to dashboard)
      })
      .catch(error => { // Handle error response
        console.error('Login failed:', error);
        // Handle login error (e.g., display error message to user)
      });
  };

  return (
    <div className="container">
        
      <div className="lg22 form-box login-form">
        <div className=" lg2 form-group">
        <h3 className='text-center h3font' style={{ color: 'blue' }}> Login</h3>
          <label className='lblp'>Username:</label>
          <input
            type="text"
            className="form-control smaller-text"
            placeholder="Enter your username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
        </div>
        <div className="lg2 form-group">
          <label className='lblp'>Password:</label>
          <input
            type="password"
            className="form-control smaller-text"
            placeholder="Enter your password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </div>
        <button className="btn btn-primary smaller-button1" onClick={handleLogin}>
          Login
        </button>

      </div>
    </div>
  );
};

export default LoginHome;
